import React, { Component } from 'react';
import { BrowserRouter as Router, Route, Link } from 'react-router-dom'
import Form from './Form/Form';
import Spreadsheet from './Spreadsheet/Spreadsheet';
import Analytics from './Analytics/Analytics';
import { makeStyles } from '@material-ui/core/styles';
import Paper from '@material-ui/core/Paper';
import Grid from '@material-ui/core/Grid';
import './landing.css'


class Landing extends Component {    
    render() {
        let classes = useStyles();
        return (
            <Router>
                <div className={classes.root}>
                    <Grid container spacing={3}>
                        <Grid item xs={12}>
                            <Paper className={classes.paper}><div id="form" className="button"><Link to="/form" className = "links">Form</Link></div>
                            </Paper>
                        </Grid>
                        <Grid item xs={6}>
                            <Paper className={classes.paper}><div id="spread" className="button"><Link to="/spread" className="links">Spreadsheet</Link></div></Paper>
                        </Grid>
                        <Grid item xs={6}>
                            <Paper className={classes.paper}><div id="analytics" className="button"><Link to="/analytics" className="links">Analytics</Link></div></Paper>
                        </Grid> 
                    </Grid>
                </div>
                       
                        <Route path="/form" exact render={() => <Form />} />
                        <Route path="/spread" exact render={() => <Spreadsheet />} />
                        <Route path="/analytics" exact render={() => < Analytics/>} />
                     
            </Router>
        )
    }
}





export default Landing;
